import react from "react";
import { Card } from "antd";

function TestCard() {
  return (
    <div>
      <Card>
        <p>Card content</p>
        <p>Card content</p>
        <p>Card content</p>
        <p>Card content</p>
      </Card>
    </div>
  );
}

export default TestCard;
